    false,nt"url": null,nt"notes": "The Light Detection and Ranging (LiDAR)
    dataset is a survey of the Suwannee River project area in Florida. The entire survey
    area encompasses 1,151 square miles. The LiDAR point cloud was flown at a nominal
    post spacing of 1.4 meters for unobscured areas. The LiDAR data and derivative products
    produced are in compliance with the U.S. Geological Survey National Geospatial Program
    Guidelines and Base Specifications, Version 13-ILMF 2010. The flightlines were acquired
    by Digital Aerial Solutions, which required 9 subsequent missions between the dates
    of January 3, 2011, and January 30, 2011. Derivative products from the aerial aquisition
    include: Raw point cloud data in LAS v1.2, classified point cloud data in LAS v1.2,
    bare earth surface (raster DEM ERDAS IMG format), hydro-flattened breaklines, control
    points, and FGDC compliant XML metadata.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
